import React from 'react';

// 假資料，之後可以從 MongoDB 獲取
const students = [
  { id: 1, name: "呱呱呱", department: "電機工程系", grade: "四年級", class: "A", email: "tkuee0787@tkuim.com" }
];

const StudentList = () => {
  return (
    <div>
      <h2>所有學生</h2>
      <ul>
        {students.map(student => (
          <li key={student.id}>
            座號: {student.id} - 姓名: {student.name} - 院系: {student.department} - Email: {student.email}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default StudentList;
